import React from 'react';
import Sidebar from '../components/Sidebar';
import SearchBar from '../components/SearchBar';
import MemberCard from '../components/MemberCard';
import Pagination from '../components/Pagination';
import './Home.css';

const members = [
  { name: 'Victor', role: 'UI UX Team Lead', profilePic: 'url-to-pic' },
  { name: 'Alexa', role: 'Sr. UI UX Designer', profilePic: 'url-to-pic' },
  { name: 'Juliet', role: 'Blockchain Dev. Team Lead', profilePic: 'url-to-pic' },
  { name: 'Hina', role: 'QA Team Lead', profilePic: 'url-to-pic' },
  { name: 'Steve', role: 'UI UX Team Manager', profilePic: 'url-to-pic' },
  { name: 'Andrielle', role: 'Sr. UI UX Designer', profilePic: 'url-to-pic' },
  { name: 'Billie', role: 'Blockchain Dev. Team Manager', profilePic: 'url-to-pic' },
  { name: 'Alita', role: 'QA Team Manager', profilePic: 'url-to-pic' },
];

function Home() {
  return (
    <div className="app">
      <Sidebar />
      <div className="content">
        <div className="header">
          <h2>Project Members</h2>
          <SearchBar />
        </div>
        <div className="members-grid">
          {members.map((member, index) => (
            <MemberCard key={index} member={member} />
          ))}
        </div>
        <Pagination />
      </div>
    </div>
  );
}

export default Home;
